import React from 'react';

const ChatwootWidget = () => {
  // Function to open Chatwoot in a new window or tab
  const openChatwoot = () => {
    const chatwootUrl = 'https://app.chatwoot.com'; // Replace with your Chatwoot URL
    window.open(chatwootUrl, '_blank');
  };

  return (
    <button onClick={openChatwoot}>Open Chatwoot</button> // You can customize this button as needed
  );
};

export default ChatwootWidget;
